Le golfe du Tonkin, ou baie de Beibu, (en vietnamien : Vịnh Bắc Bộ ; chinois : 北部湾), mesure environ 470 km par 240 km, se situe entre la Chine et le Viêt Nam. Assez peu profond dans son ensemble (moins de 60 m), il est le bras nord-ouest de la mer de Chine méridionale. Il est fermé à l'est par le péninsule de Leizhou et l'île Hainan. Dans le golfe, les ports principaux sont Beihai (Chine) et Haïphong (Viêt Nam). On y trouve plusieurs îles, dont : 
* Hainan, la plus grande ; 
* Weizhou. Le fleuve Rouge y déverse ses eaux. La baie de Hạ Long qui le borde au nord-ouest, non loin de Haïphong, est probablement le site touristique le plus connu du golfe. Le nom « Tonkin » (en chinois : 東京 et en vietnamien : Đông Kinh), veut dire « capitale de l'est » et est l'un des anciens noms de Hanoï, la capitale du Viêt Nam.
